CREATE TABLE booking (
  book_date date NOT NULL default '0000-00-00',
  court int(11) NOT NULL default '0',
  slot int(11) NOT NULL default '0',
  memberid varchar(100) NOT NULL default '',
  created_by varchar(100) NOT NULL default '',
  opponentid varchar(100) default NULL,
  confirm_date datetime default NULL,
  confirm_user varchar(20) default NULL,
  status char(1) NOT NULL default 'O',
  charge double NOT NULL default '0',
  reminder_sent int(1) NOT NULL default '0',
  PRIMARY KEY  (book_date,court,slot),
  KEY book_member (memberid),
  KEY book_opponent (opponentid)
) ENGINE=MyISAM  COMMENT='Court Bookings';

